import React from 'react';
import AnimatedCursor from 'react-animated-cursor';

export default Cursor = () => { 
	return (
		<AnimatedCursor 
			innerSize={8}
			outerSize={8}
			color='193, 11, 111'
			outerAlpha={1}
			innerScale={0.7}
			outerScale={5}
		/>
	)
}
